<script>


    $('.navbar-toggler').click(function () {
    $(this).toggleClass('active');
    $('.navigation-menu').toggleClass('hidden');
    $('#navbar').addClass('bg-gradient-to-b from-purple-400 to-purple-400');
    });
    $(function () {
    var navigation = $("#navbar");
    

    $(window).scroll(function () {
        var scroll = $(window).scrollTop();
        if (scroll >= 100) {
        navigation.addClass("bg-gradient-to-b from-purple-400 to-purple-400 xl:py-1 shadow-md");
        navigation.removeClass("xl:py-1");

        
        } else {
        navigation.removeClass("bg-gradient-to-b from-purple-400 to-purple-400 xl:py-1 shadow-md");
        navigation.addClass("xl:py-1");

     
        }
    });
    });

</script>